         y="0"
         id="tspan136">Copenhagen Jazz Festival har eksisteret siden 1979 </tspan><tspan
         x="0 5.8045001 11.609 14.516 19.798 23.4935 26.400499 31.682501 37.487 40.394001 45.675999 49.371498 52.2785 57.560501 63.365002 67.060501 72.864998 78.669502 83.9515 87.647003 90.554001 94.249496 97.945 103.7495 107.445 111.1405 114.836 120.118 123.025 125.666 130.948 135.698 140.448 144.14349 149.42551 153.121 156.8165 159.4575 164.2075 169.4895 172.13049 177.41251 181.108 183.74899 186.65601 193.515 198.265 203.547 207.24249"
         y="11.9985"
         id="tspan138">og er en af Europas største jazzfestivaler. Hver </tspan><tspan
         x="0 3.6954999 9.5 17.945499 26.391001 31.673 35.3685 38.275501 41.971001 47.775501 51.471001 56.221001 61.502998 67.307503 73.112 75.752998 81.035004 84.730499 87.637497 93.973999 99.778503 105.583 110.865 116.6695 122.474 127.756 132.506 138.3105 140.95151 143.85851 149.66299 154.94501 158.6405 161.5475 165.243 170.52499 174.2205 177.916 180.55701 185.30701 190.589 193.23 198.51199 204.3165 207.2235 209.8645 212.7715 218.0535 223.33549"
         y="23.997"
         id="tspan140">sommer forvandles København, når festivalen i 10 </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.08 27.721001 30.628 34.323502 38.019001 46.4645 51.746498 54.6535 58.348999 63.631001 66.272003 69.967499 75.249496 78.945 81.851997 84.492996 89.775002 94.525002 99.275002 104.557 110.3615 113.2685 115.9095 118.8165 124.0985 126.7395 129.38049 134.66251 137.5695 143.37399 148.65601 154.46049 158.15601 161.063 166.345 170.0405 173.73599 179.01801 183.76801 189.57249 195.377 198.01801 203.82249 209.627 214.909 218.60451 221.2455"
         y="35.995499"
         id="tspan142">dage i træk fejrer jazzen i alle dens afskygninger. </tspan><tspan
         x="0 8.9680004 14.7725 18.468 21.108999 26.391001 31.673 36.955002 42.759499 45.6665 49.362 55.1665 57.807499 60.448502 63.0895 68.371498 72.067001 74.973999 80.778503 85.528503 90.810501 94.505997 99.788002 102.429 106.1245 108.7655 111.6725 114.3135 117.2205 123.025 128.30701 132.0025 137.2845 142.5665 146.26199 149.16901 154.9735 160.778 163.685 169.4895 174.7715 179.5215 184.8035 188.49899 191.14 194.047 199.8515 205.1335 208.0405 213.845 218.595 223.877 229.6815 233.377"

         y="23.997"
         id="tspan188">sig på at bringe operaen ud af de vante rammer, </tspan><tspan

         y="131.98351"
